import {scaleLinear} from "d3-scale"
export const calculateGridPos = (
	i: number,
	perRow: number,
	pathWidth: number
) => {
	return [
		((i % perRow) + 0.5) * pathWidth,
		(Math.floor(i / perRow) + 0.5) * pathWidth,
	]
}

export const scaleCoordinates = (number, domain) => {
	const scaledNumber = scaleLinear().domain(domain).range([0, 150])
	return scaledNumber(number)
}

